import React from 'react';


export default ({ data, page, onClick , text}) => {

    let list = [];

    let html_ = page == 4 ? '結束':list[page];


    for (let i = 0; i < data.length; i++)
    {

        list.push(
            
            <ul class="list-group">
                <li class="list-group-item"><input type="checkbox"/></li>
                <li class="list-group-item"><input type="checkbox"/></li>
                <li class="list-group-item"><input type="checkbox"/></li>
            </ul>
        )
    }

    return (
        <div>
            <h3>{page}</h3>
            {html_}
            <button class="btn btn-outline-secondary" type="button" onClick={onClick}>{text}</button>
        </div>
    )
};
